class Random():
    __seed = None
    __xn   = None
    __a    = None
    __c    = None    

    @classmethod
    def set_parameters(cls, seed, a, c):
        cls.__seed = seed
        cls.__xn   = 1/seed
        cls.__a    = a
        cls.__c    = c
        cls.__base = pi
    
    @classmethod
    def random(cls, min=0, max=1):
        ca = int(cls.__a % len(cls.__base))
        cc = int(cls.__c % len(cls.__base))
        cls.__a = int(cls.__base[ca:ca+16])
        cls.__c = int(cls.__base[cc:cc+16])
        cls.__xn = (cls.__a*1e-8)*cls.__xn+(cls.__c*1e-8)
        cls.__xn = (cls.__xn%(max-min)) + min
        return cls.__xn

